style.css:
body {
  background-color: #fbf6e5; /* Change background color */
  color: #354956; /* Change main text color */
}

a {
  color: #5a5ad6; /* Change link color */
}

a:hover {
  color: #b863f7; /* Change color of links when hovered */
}

::selection {
  background: #19c37d; /* Change background color of highlighted text */
  color: #19c37d; /* Change text color of highlighted text */
}
